// Dokumenty.js
import React, { useEffect, useState } from "react";
import Sidebar from "./Sidebar";
import Header from "./Header";
import "./Dokumenty.css";

const Dokumenty = () => {
  const [documents, setDocuments] = useState([]);
  const user = JSON.parse(localStorage.getItem("user")) || {};

  useEffect(() => {
    // Mock data to simulate documents
    const mockDocuments = [
      {
        id: 1,
        name: "Faktura_Januar",
        popis: "January invoice for utilities.",
        type: "faktura",
        fileType: ".pdf",
        url: "/files/faktura_januar.pdf",
      },
      {
        id: 2,
        name: "Zaznam_Schodza",
        popis: "Meeting notes from January 2023.",
        type: "zaznam zo schodze",
        fileType: ".txt",
        url: "/files/zaznam_schodza_jan.txt",
      },
      {
        id: 3,
        name: "Faktura_Februar",
        popis: "February invoice for utilities.",
        type: "faktura",
        fileType: ".pdf",
        url: "/files/faktura_februar.pdf",
      },
    ];

    // Set mock data
    setDocuments(mockDocuments);
  }, []);

  const handleLogout = () => {
    localStorage.removeItem("isAuthenticated");
    window.location.href = "/";
  };

  return (
    <div className="dashboard-container">
      <Sidebar />
      <div className="main-content">
        <Header user={user} onLogout={handleLogout} />
        <div className="dokumenty-content">
          <h1>Dokumenty</h1>
          <table className="documents-table">
            <thead>
              <tr>
                <th>Name</th>
                <th>Popis</th>
                <th>Type</th>
                <th>File Type</th>
                <th>Action</th>
              </tr>
            </thead>
            <tbody>
              {documents.map((doc) => (
                <tr key={doc.id}>
                  <td>{doc.name}</td>
                  <td>{doc.popis}</td>
                  <td>{doc.type}</td>
                  <td>{doc.fileType}</td>
                  <td>
                    <a href={doc.url} target="_blank" rel="noopener noreferrer">
                      View
                    </a>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </div>
    </div>
  );
};

export default Dokumenty;
